var title_f36_48_37639="Tumor evolution in AML";
var content_f36_48_37639=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F84023&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F84023&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 742px\">",
"   <div class=\"ttl\">",
"    Examples of the two major patterns of tumor evolution in acute myeloid leukemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 722px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Model 1 shows the dominant clone in the primary tumor evolving into the relapse clone by gaining relapse specific mutations; this pattern was identified in three primary tumor and relapse pairs. Model 2 shows a minor clone carrying the vast majority of the primary tumor mutations survived and expanded at relapse. This pattern was observed in five primary tumor and relapse pairs.",
"    <div class=\"footnotes\">",
"     AML: acute myeloid leukemia; HSCs: hematopoietic stem cells.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by permission from: Macmillan Publishers Ltd: Nature 2012; 481:506. Ding L, Ley TJ, Larson DE, et al. Clonal evolution in relapsed acute myeloid leukemia revealed by whole-genome sequencing. Copyright &copy; 2012.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
