var title_f36_48_37643="Vaginal estrogen";
var content_f36_48_37643=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F58506&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F58506&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Vaginal estrogen preparations available in the United States for treatment of vaginal atrophy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Preparation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Available strengths",
"       </td>",
"       <td class=\"subtitle1\">",
"        Regimen",
"        <br/>",
"        (recommended by manufacturer)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Vaginal ring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estring&reg;",
"       </td>",
"       <td>",
"        7.5 mcg estradiol/day, released over 90 days",
"       </td>",
"       <td>",
"        Ring is inserted into the vaginal by the patient or clinician. Ring is removed and replaced with a new ring every 90 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Vaginal tablet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vagifem&reg;",
"       </td>",
"       <td>",
"        10 mcg estradiol/tablet",
"       </td>",
"       <td>",
"        Insert 1 tablet intravaginally daily for 2 weeks, followed by twice weekly.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Vaginal cream",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Premarin&reg;",
"       </td>",
"       <td>",
"        0.625 mg conjugated estrogens/g of cream",
"       </td>",
"       <td>",
"        0.5 g of cream intravaginally administered twice weekly. Cyclic regimen also listed in instructions for use, but not commonly used.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estrace&reg;",
"       </td>",
"       <td>",
"        100 mcg estradiol/g of cream",
"       </td>",
"       <td>",
"        2 to 4 g of cream intravaginally administered daily for one or 1 or 2 weeks, then gradually reduce to half the initial dosage for a similar period. A maintenance dosage of 1 g of cream, 1 to 3 times per week may be used.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
