"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Tarsal tunnel anatomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 373px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The tarsal tunnel syndrome is caused by entrapment of the posterior tibial nerve beneath the flexor retinaculum on the medial side of the ankle. Entrapment may also include the two branches, the medial and lateral plantar nerves.",
"    <div class=\"footnotes\">",
